from feladat import substringDiff

def test(k, s1, s2, expected):
    result = substringDiff(k, s1, s2)

    print(result == expected)

s1 = ""
s2 = ""
test(11, s1, s2, 256)
test(0, "abcd", "abcd", 4)
test(1, "abcd", "abcf", 4) 
test(0, "abcd", "efgh", 0)
test(1, "abcd", "abce", 4)
test(2, "abcdefgh", "abcfefgh", 8)
test(4, "xyzabcd", "abcdxyz", 4)
test(2, "abcxyz", "xyzabc", 3)
test(3, "aaaabbbb", "bbbbcccc", 5)
test(5, "a"*10, "b"*10, 5) 
test(1, "abcabcabc", "abcabcxyz", 7)
